import { Fragment } from "react";
import { useParams } from "react-router-dom";

const QuoteDetail = () => {
  let id = useParams().quoteId;
  return (
    <Fragment>
      <h1>Quote Details Page</h1>
      <p>{id}</p>
    </Fragment>
  );
};

export default QuoteDetail;
